import React from 'react'
import {ProductsPopupItemContainer, Label, ProductItem} from "./products-popup-item.styles";
const ProductsPopupItem = ({productLabel, productList}) => {
  console.log(productList)
  return (
    <ProductsPopupItemContainer>
      <Label>{productLabel}</Label>
      {productList.filter((_,idx) => idx < 10).map(product => (
        <ProductItem>{product.name}</ProductItem>
      ))}
    </ProductsPopupItemContainer>
  )
}

export default ProductsPopupItem
